  `user_id` bigint unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `company_id` bigint unsigned NOT NULL COMMENT 'Ссылка на организацию',
  `job_position_id` bigint unsigned NOT NULL COMMENT 'Ссылка на должность',
  `city_id` bigint unsigned NOT NULL COMMENT 'Ссылка на город',
  `date_start` datetime DEFAULT NULL COMMENT 'Дата начала',
  `date_finish` datetime DEFAULT NULL COMMENT 'Дата завершения',
  `is_work_now` tinyint(1) DEFAULT '0' COMMENT 'работает сейчас',
  `flag_access` enum('all','friends','nobody') DEFAULT NULL COMMENT 'доступно всем/друзьям/никому',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `user_id` (`user_id`),
  KEY `company_id` (`company_id`),
  KEY `job_position_id` (`job_position_id`),
  KEY `city_id` (`city_id`),
  CONSTRAINT `users_works_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `users_works_ibfk_2` FOREIGN KEY (`company_id`) REFERENCES `companies` (`id`),
  CONSTRAINT `users_works_ibfk_3` FOREIGN KEY (`job_position_id`) REFERENCES `job_positions` (`id`),
  CONSTRAINT `users_works_ibfk_4` FOREIGN KEY (`city_id`) REFERENCES `cities` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Места работы';
